import sys

def minp():
	return sys.stdin.readline().strip()

def mint():
	return int(minp())

def mints():
	return list(map(int,minp().split()))

def solve():
	n,m = mints()
	a = [list(minp()) for i in range(n)]
	r = n
	for i in range(n):
		for j in range(m):
			if a[i][j] == '*':
				r-=1
				if r < 0:
					break
	if r == 0:
		print("YES")
	else:
		print("NO")

solve()
